generate_rank_sign() {
      let sign = this.get_include_sign();
      let current = this.numberModel.count - 1;

      let arr = [];
      let min = '',
        max = '';
      for (let i = 0; i < current; i++) {
        min += 1;
        max += sign.length + 1;
      }

      for (let i = min; i <= max; i++) {
        let str_i = i + '';
        let flag = str_i.split('').some(el => el > sign.length || el == 0);
        if (!flag) {
          arr.push(str_i);
        }
      }
      return arr
        .map(el => el.split(''))
        .map(el => el.map((e, i) => sign[e - 1]));
